import React from 'react';
import SecOne from './SecOne';
import SecTwo from './SecTwo';

export default class SectionOnee extends React.Component {
  state = {
    icon: '',
  };

  iconOne = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-heartbeat'></i> };
    });
  };

  iconTwo = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-briefcase-medical'></i> };
    });
  };

  iconThree = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-bell'></i> };
    });
  };

  iconFour = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-map-marker-alt'></i> };
    });
  };

  iconFive = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-fingerprint'></i> };
    });
  };

  iconSix = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-mobile'></i> };
    });
  };

  render() {
    return (
      <div className='section3'>
        <SecOne
          iconOne={this.iconOne}
          iconTwo={this.iconTwo}
          iconThree={this.iconThree}
        />
        <div className='thicon'>{this.state.icon}</div>
        <SecTwo
          iconOne={this.iconOne}
          iconTwo={this.iconTwo}
          iconThree={this.iconThree}
        />
      </div>
    );
  }
}
